import React from "react"

import { Formik, Field, Form, FormikHelpers } from 'formik';

interface Values {
  from: string;
  to: string;
  direction: string;
  // date?: Date | null;
}

const Finder = () => {
  return (
    <div>
      <h1>Signup</h1>
      <Formik
        initialValues={{
          from: '',
          to: '',
          direction: '',
          // date: null,
        }}
        onSubmit={(
          values: Values,
          { setSubmitting }: FormikHelpers<Values>
        ) => {
          setTimeout(() => {
            alert(JSON.stringify(values, null, 2));
            setSubmitting(false);
          }, 500);
        }}
      >
        <Form>
          <label htmlFor="from">Откуда</label>
          <Field id="from" name="from" placeholder="Откуда" />

          <label htmlFor="to">Last Name</label>
          <Field id="to" name="to" placeholder="Куда" />

          <label htmlFor="direction">direction</label>
          <Field
            id="direction"
            name="direction"
            placeholder="Рижское"
          />

          {/* <label htmlFor="date">Дата</label>
          <Field
            id="date"
            name="date"
            placeholder="Рижское"
            type="date"
          /> */}

          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  )
}

export default Finder
